message:
AÇÕES PARA NÃO PERDER A LUTA DO POVO...

Os ladrões que TOMARAM O PODER GANHAM...

1 - SE... NÃO FOR MILHÕES PARA BRA-SÍ-LIA (pouca gente é fácil de policial dominar) PARA PEDIR INTERVENÇÃO MILITAR NOS TRÊS PODERES;

2 - SE... OS MILHÕES NÃO INVADIREM OS TRÊS PODERES E PERMANECEREM LÁ TODOS JUNTOS PARA GARANTIR QUE UMA FORÇA POLICIAL NÃO POSSA DISPERSAR OS QUE FICAREM POR ESVAZIAMENTO;

3 - SE... NÃO TIVEREM ESTRUTURA PARA SE MANTER DEPOIS DA INVASÃO;

4 - SE... NÃO HOUVER UMA COMISSÃO DE TRANSIÇÃO DE GOVERNO ORGANIZADA PARA GARANTIR QUE AS REIVINDICAÇÕES SEJAM ATENDIDAS;

5 - SE... AS FORÇAS ARMADAS NÃO ATENDEREM O APELO DE INTERVENÇÃO MILITAR;

6 - SE... EM HAVENDO GENERAIS CORRUPTOS QUE ESTÃO AO LADO DOS LADRÕES DO PODER, OS COMANDANTES PATRIOTAS NÃO TOMAREM A INICIATIVA DE NÃO SEREM COPTADOS PELOS CORRUPTOS ENTRE OS MILITARES E NÃO FOREM PARA AS RUAS E PARA O PODER TOMADO APOIAR O POVO;

Então, se as condições do fracasso para impedir um governo ilegítimo ocorrer... 

1 - os ladrões quebrarão as empresas, saquearão o país, e permitirão monopólio das empresas traidoras do povo;

2 - seguirão com o plano de perseguir, cooptar mídias; 

3 - impor a vacina de rastreamento e que MATA COM COAGULAÇÃO;

4 - MILITARES SERÃO HUMILHADOS COM PODER DIMINUÍDO;

5 - POPULAÇÃO DESARMADA, POLICIAIS DESARMADOS, TERROR INSTALADO;

6 - SEREMOS COLOCADOS DEBAIXO DA ESCRAVIDÃO DA NOM (Nova Ordem Mundial), CHIPADOS.

7 - NUNCA MAIS VOCÊ SABERÁ O QUE OCORRE COM O TRÁFICO HUMANO;

Entre outras coisas..

